import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Container, Navbar, Nav } from 'react-bootstrap';

function App() {
  return (
    <div className="d-flex flex-column min-vh-100">
      {/* Header */}
      <Navbar bg="dark" variant="dark" expand="lg" className="w-100">
        <Container fluid>
          <Navbar.Brand href="#" className="fw-bold text-warning">
            Curso<span className="text-white">Finder</span>
          </Navbar.Brand>
          <Navbar.Toggle aria-controls="navbar-content" />
          <Navbar.Collapse id="navbar-content">
            <Nav className="ms-auto">
              <Nav.Link href="#" className="text-white">Home</Nav.Link>
              <Nav.Link href="#" className="text-white">Categorias</Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>

      {/* Espaço central vazio para simular tela cheia */}
      <div className="flex-grow-1 bg-secondary d-flex justify-content-center align-items-center">
        <h2 className="text-white">Conteúdo principal aqui (futuro)</h2>
      </div>

      {/* Footer */}
      <footer className="bg-dark text-white text-center py-3 w-100">
        © 2025 CursoFinder - Todos os direitos reservados
      </footer>
    </div>
  );
}

export default App;
